import React from 'react';
import './LandingPage.css';
import Signup from './Signup/Signup';
import Signin from './Signin/Signin';
import NavigationLandingPage from './NavigationLandingPage/NavigationLandingPage';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import { Jumbotron } from 'react-bootstrap';
//Navbar, Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

function LandingPage() {
    return (
        <div className="LandingPage">
            <Router>
                <Route exact path="/" component={LandingPage} />
                <Route path="Signup" component={Signup} />
                <Route path="Signin" component={Signin}/>
            </Router>

            <NavigationLandingPage />
            <Jumbotron>
            <h1 className="titleLandingPage">Anastasia</h1>
            <p>Listen to your music, create your playlists, Share them with others.</p>
            <p>Anastasia is probably the best streaming music platform, you can subscribe or listen for free.</p>
            </Jumbotron>
            </div>
    );
}

export default LandingPage;
